import React from "react";
import AdminRoute from '../../adminRoute';

/* Begin Import Components */
import ProductList from "./productList";
import ProductCreate from "./productCreate";
import ProductDelete from "./productDelete";
import ProductEdit from "./productEdit";
/* End Import Components */

function App(props) {

  return (
    <div className="container">
        {/* Begin Routes */}
            <AdminRoute path="/products/" exact component={ProductList} />
            <AdminRoute path="/products/add" exact component={ProductCreate} />
            <AdminRoute path="/products/:id/delete" exact component={ProductDelete} />
            <AdminRoute path="/products/:id/edit" exact component={ProductEdit} />
        {/* End Routes */}
    </div>
  );
}

export default App;
